import {useState} from "react";

function Square({value, onSquareClick }){
    return (
        <button
        className="square"
        onClick={onSquareClick}
        ></button>
    )
}
export default function Board(){
    return (
    <>
        <div className="board-row">
            <button className="square"></button>
            <button className="square"></button>

        </div>
        <div className="board-row"></div>
        <div className="board-row"></div>
    
    
    </>);
}
